import React from 'react';
import ReactAudioPlayer from 'react-audio-player';
import { data } from './database';

function AccessibleCaptcha() {
  return (
    <React.Fragment>
      <p>{data[0].question}</p>
      <ReactAudioPlayer
        src="my_audio_file.ogg"
        autoPlay
        controls
      />
    </React.Fragment>
  );
}

export default AccessibleCaptcha;
